import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({name, description}) => {
  return (
    <div>
      {Object.values().map(({ name, ...rest }, index) => (
        <Tile name={name} description={rest} key={index} />
      ))}
    </div>
  );
};
